import HeaderTop from "./HeaderTop";
import HeaderBottom from "./HeaderBottom";

class Header extends Component {
    render() {
        return (
            <div>
                <HeaderTop />
                <HeaderBottom />
            </div>
        );
    }
}

export default Header;
